window.bookSummaryJSON = "<p><b>Darkness Calls box set: Books 6-8 of the Guardians of the Fae Realms fantasy romance series.</b></p> <p><i>A curse to break. A sister to find. A quadrant to reclaim.</i></p> <p>My father and mother are the late Fae Prime and his Prima, my brother, Kotah, the new king. I'm nothing as grand as them. I'm the daughter, the sister, the liaison between Kotah and the life of rule he never wanted....</p> <p>Until the fae universe intervenes.</p> <p>I had my heart set on the male I wanted, but my destiny was so much bigger than that. Now, with Doc, Creed, and Rhylan in the mix, I realize the universe might know what it's doing after all.</p> <p>With a quadrant scared to hope and a corrupt, usurper queen trying to stop us at all costs, the four of us lock in to fight the wrongs of the past - and ensure our happily ever after.</p> <p><i>The Darkness Calls Trilogy is the second harem of the Guardians of the Fae Realms, a steamy reverse harem paranormal romance series. Expect sexy polyamorous situations (mmmfm), rollicking action, ongoing storylines, and shifter lovers who find what they need from not only their queen but each other as well. Med-burn, med angst, vivid sexual content, and language.</i></p>"; 
